import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 20, height: 20, viewBox: "0 0 20 20", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M5.79 6.82a2.63 2.63 0 013.83 0l.38.4.37-.39a2.64 2.64 0 013.83.01 2.9 2.9 0 01.01 3.98l-3.9 4.05a.4.4 0 01-.59 0L5.8 10.8a2.9 2.9 0 01-.01-3.98zM10 2a8 8 0 100 16 8 8 0 000-16zm-7 8a7 7 0 1114 0 7 7 0 01-14 0z", fill: primaryFill }));
};
const HeartCircle20Regular = wrapIcon(rawSvg({}), 'HeartCircle20Regular');
export default HeartCircle20Regular;
